"use strict";

$('#resend-otp').click(function () {
  var _this = this;

  $(this).prop('disabled', true);
  var user_id = $(this).data('user_id');
  $.post("/users/confirmotp/resend-otp/".concat(user_id), function () {
    console.log('resend success');
  }).done(function () {
    $('.resend-success-fail').append("\n\t\t\t<div class=\"alert alert-success alert-dismissible fade show\" role=\"alert\">\n\t\t\tresend success. check your mail again.\n\t\t\t<button type=\"button\" class=\"close\" data-dismiss=\"alert\" aria-label=\"Close\">\n\t\t\t\t\t<span aria-hidden=\"true\">&times;</span>\n\t\t\t\t\t</button>\n\t\t\t</div>\n\t\t\t");
  }).always(function () {
    $(_this).prop('disabled', false);
  });
});
